  \"1994\"}]\"\n\t},\n\t{\n\t\t\"key\": \"graphic-preview-description\",\n\t\t\"value\":
  \"Parking structure on the campus of California State University. The bowed columns
  are of reinforced concrete. The structure has precast moment- resisting-concrete
  frames on the exterior and a precast concrete interior designed for vertical loads.
  The inside of the structure failed, and with each aftershock the outside collapsed
  slowly toward the inside until finally the west side failed totally. The reinforced
  concrete columns were extremely bent.\"\n\t},\n\t{\n\t\t\"key\": \"frequency-of-update\",\n\t\t\"value\":
